import React, { useState,useEffect } from 'react';
import './style.css';
import { useLocation } from 'react-router';
import { Card } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const ResultPage = () =>{
    const location = useLocation();
    const data = location.state;

    const checking = data.result <= 30;

    if (checking) {
        return(
            <div className="container resultPage">
                <h1>PLAGIARISM CHECKER</h1>
                <div className="row">
                    <div className="col-sm-9">
                        <Card className="textWrapper">
                            <Card.Body className="scroll">
                                <p>{data.data}</p>
                            </Card.Body>
                        </Card>
                    </div>
                    <div className="resultCheck">
                        <div className="percentResult">
                            <p>{data.result}</p><span>%</span>
                            <hr />
                        </div>
                        <div><p>You are Save</p></div>
                    </div>
                </div>
            </div>
        )
    } else {
        return(
            <div className="container resultPage">
                <h1>PLAGIARISM CHECKER</h1>
                <div className="row">
                    <div className="col-sm-9">
                        <Card className="textWrapper">
                            <Card.Body className="scroll">
                                <p>{data.data}</p>
                            </Card.Body>
                        </Card>
                    </div>
                    <div className="resultCheck">
                        <div className="percentResult">
                            <h1>{data.result} %</h1>
                        </div>
                        <div><p>You are Danger</p></div>
                    </div>
                </div>
            </div>   
        )
    }
}

export default ResultPage;
